import React from 'react';
import Layout from './Components/Layout/Layout';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

const App = () => {

  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Layout />}/>
        </Routes>
      </BrowserRouter>
    </>
  )
}
export default App;
